script: |
  super -f text -I q409.spq | sort > q409.out

inputs:
  - name: q409.spq
    data: |
      SELECT ALL - 23 * + col1 FROM tab0 (FORMAT parquet) WHERE - col1 * + - 65 + - 28 * + col0 NOT IN ( - + ( + col1 ) );
  - name: tab0

outputs:
  - name: q409.out
    data: |
      -1863
      -23
      -483
